import { Box, Typography } from "@mui/material";
import React from "react";

function PlayStore() {
  return (
    <Box
      sx={{
        display: "grid",
        maxWidth: "120%",
        margin: "0 auto",
        padding: 0,
        height: "600px",
        backgroundColor: "#EAF7FA;",
        marginTop: "100px",
        textAlign: "start",
        alignItems: "start",
        // overflow: "hidden",
      }}
    >
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          fontSize: "2.9rem",
          fontWeight: "700",
          lineHeight: 1.2,
          padding: "55px",
          letterSpacing: "0.015em",
          wordSpacing: "0.001em",
        }}
      >
        Download the{" "}
        <Box
          component="span"
          sx={{
            color: "#3593b0",
            position: "relative",
            display: "inline-block",
            "&::after": {
              content: '""',
              position: "absolute",
              left: 40,
              bottom: "-8px",
              width: "89%",
              height: "4px",
              backgroundColor: "black",
              borderRadius: "5px",
            },
          }}
        >
          MyMoneyMantra
        </Box>
        <br />
        Mobile App
      </Typography>
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          display: "flex",
          fontSize: "20px",
          fontWeight: "600px",
          color: "black",
          marginLeft: "80px",
        }}
      >
        <ul
          style={{
            listStyleType: "none",
            padding: 0,
            margin: 0,
            lineHeight: "2.3",
          }}
        >
          <li>Enjoy a seamless experience.</li>
          <li>Get exclusive Loans and Credit Card offers.</li>
          <li>Track your credit score anytime anywhere</li>
        </ul>
      </Typography>
      <Box
        sx={{
          display: "flex",
          marginTop: "15px",
          gap: "80px",
          marginLeft: "80px",
          mb: 8,
        }}
      >
        <img
          src="/playstore/pic1.jpg"
          alt="Play Store"
          style={{ width: "250px", cursor: "pointer" }}
        />
        <img
          src="/playstore/pic2.jpg"
          alt="App Store"
          style={{ width: "250px", cursor: "pointer" }}
        />
      </Box>
      <Box sx={{ width: "50%", display: "flex", justifyContent: "center" }}>
        <img
          src="/playstore/pic3.jpg" // Replace with your actual image path
          alt="Promo Banner"
          style={{
            width: "90%", // Adjust width to fit available space
            maxWidth: "500px", // Prevents it from being too large
            height: "50%",
          }}
        />
      </Box>
    </Box>
  );
}

export default PlayStore;
